    return(
        <Menu style={{marginTop: '10px'}}>
            <Link href="/">
                CrowdCoin
            </Link>
            <Menu.Menu position="right">
                <Menu.Item>
                    Campaigns
                </Menu.Item>
                <Menu.Item>
                    +
                </Menu.Item>
            </Menu.Menu>
        </Menu>
    )
};
